  false,\n\t\"url\": null,\n\t\"notes\": \"The following objectives for Agassiz NWR
  are described in this plan: (1) to provide waterfowl habitat for production and
  maintenance; (2) to provide suitable habitat for moose and white-tailed deer; and
  (3) to provide food and habitat for rare and endangered species. Inventory procedures
  are provided for the breeding pair survey, waterfowl surveys, duck production, Canada
  goose production, the colonial nesting bird survey, the ruffed grouse drumming count,
  moose population surveys, white-tailed deer surveys, and general inventories.\",\n\t\"license_title\":
